#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>
#include <string.h>
#include <limits.h>

#define LEN ('z'-'a'+1)

bool isAnagram(char* s, char* t) {
    int letterMap[LEN];
    int len, i;

    memset(letterMap, 0, sizeof(int) * LEN);

    for (len = 0; *s; s++, len++)
        ++letterMap[*s - 'a'];
    for (; *t; t++, len--) {
        if (0 == letterMap[*t - 'a'])
            return false;
        --letterMap[*t - 'a'];
    }
    if (len) return false;
    return true;
}

int main(int argc, char *argv[])
{
    printf("%d\n", isAnagram("anagram", "nagaram"));
    printf("%d\n", isAnagram("", ""));
    return 0;
}
